    const { transactions } = useContext(GlobalContext);


	return (

     <>

       <h3>History</h3>

         <ul className="list">
           {transactions.map(transactions => (<li className="minus">
             {transactions.text} <span>-$400</span><button className="delete-btn">x</button>     
           </li>))}

         </ul>

     </>

 )
}
